// Dashboard.js
import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import axios from '../config/axiosConfig';


const MovieList = () => {
    const [movies, setMovies] = useState([]);
    const navigate = useNavigate();


    useEffect(() => {
        const fetchMovies = async () => {
        try {
            const response = await axios.post('listmovies');
            if (response.status === 200) {
                setMovies(response.data.results);
            }
        } catch (error) {
          alert('Error fetching movies:', error);
        }
      };

      fetchMovies();
    }, []);

    const handleAdd = () =>{
        navigate('/createmovie');
    }

    const handleDelete = async () => {
      if (window.confirm('Are you sure you want to delete this movie?')) {
        try {
          await axios.delete('deletemovies/'+id);
          alert('Movie deleted successfully!');
          navigate('/movies'); // Redirect to the movies list page after deletion
        } catch (error) {
          console.error('Error deleting movie:', error);
        }
      }
    };

  return (
    <div className="card shadow">
  <div className="card-body">
    <div className="toolbar row mb-3">
      <div className="col">
        <form className="form-inline">
          <div className="form-row">
            <div className="form-group col-auto">
              <label htmlFor="search" className="sr-only">
                Search
              </label>
              <input
                type="text"
                className="form-control"
                id="search"
                defaultValue=""
                placeholder="Search"
              />
            </div>

          </div>
        </form>
      </div>
      <div className="col ml-auto">
        <div className="dropdown float-right">
          <button className="btn btn-primary float-right ml-3" type="button" onClick={handleAdd}>
            Add more +
          </button>
          <button className="btn btn-primary float-right ml-3" type="button">
            Bulk Delete
          </button>

        </div>
      </div>
    </div>
    {/* table */}
    <table className="table table-bordered">
      <thead>

        <tr role="row">
          <th>
            <div className="custom-control custom-checkbox">
              <input
                type="checkbox"
                className="custom-control-input"
                id="all"
              />
              <label className="custom-control-label" htmlFor="all" />
            </div>
          </th>
          <th>Title</th>
          <th>Release Date</th>
          <th>Genre</th>
          <th>Description</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        {movies.map((movie) => (
           <tr>
                <td>
                    <div className="custom-control custom-checkbox">
                    <input
                        type="checkbox"
                        className="custom-control-input"
                        id={movie.id}
                    />
                    <label className="custom-control-label" htmlFor={movie.id} />
                    </div>
                </td>
                <td>{movie.title}</td>
                <td>{movie.release_date}</td>
                <td>{movie.genre}</td>
                <td>{movie.description}</td>
                <td>
                    <Link to={`/editmovies/${movie.id}`}>Edit</Link>
                    &nbsp;&nbsp;
                    <Link to={`/deletemovies/${movie.id}`}>Remove</Link>
                </td>
           </tr>
        ))}
      </tbody>
    </table>
    <nav aria-label="Table Paging" className="mb-0 text-muted">
      <ul className="pagination justify-content-end mb-0">
        <li className="page-item">
          <a className="page-link" href="#">
            Previous
          </a>
        </li>
        <li className="page-item">
          <a className="page-link" href="#">
            1
          </a>
        </li>
        <li className="page-item">
          <a className="page-link" href="#">
            2
          </a>
        </li>
        <li className="page-item">
          <a className="page-link" href="#">
            3
          </a>
        </li>
        <li className="page-item">
          <a className="page-link" href="#">
            Next
          </a>
        </li>
      </ul>
    </nav>
  </div>
</div>

  );
};

export default MovieList;
